import React, { Component } from 'react';
import { Row, Table, Form } from 'react-bootstrap'
import axios from 'axios'
import MuhalikConfig from '../../../../../../sdk/muhalik.config'
import GlobalStyleSheet from '../../../../../../styleSheet'

class AllProducts extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }
    // Getting Product Categories from DB
    async componentDidMount() {
        const url = MuhalikConfig.PATH + '/api/products/';
        try {
            const response = await axios.get(url);
            console.log('data:', response.data.data)

        } catch (error) {
            console.log('Data Fetching Eror:', error);
        }
    }

    render() {
        return (
            <>
                <Row noGutters style={{ margin: '2%', background: 'white' }}>
                    <Table striped bordered hover size="sm" style={styles.table}>
                        <thead>
                            <tr>
                                <th>
                                    <Form.Check type="checkbox" />
                                </th>
                                <th>Name</th>
                                <th>SKU</th>
                                <th>Stock</th>
                                <th>Price</th>
                                <th>Categories</th>
                                <th>Tags</th>
                                <th>Date</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td>1</td>
                                <td>Mark</td>
                                <td>Otto</td>
                                <td>@mdo</td>
                            </tr>
                        </tbody>
                    </Table>
                </Row>
            </>
        );
    }
}

const styles = {
    // table: {
    //     margin: '2%'
    // },
}
export default AllProducts;
